function Quotes(){

        var cranny;

        var rows=[ <div>init</div>, ];

        fetch('https://fakerapi.it/api/v1/persons?_quantity=20', {
                method: 'GET',
                // mode: "no-cors",
            })
            .then(
                 res => {
                    return res.json();
                }
            )
            .then(
                data => {

                    for (var i=0;i<data.data.length;i++){
                        rows.push(<tr><td>{data.data[i].id}</td><td>{data.data[i].firstname}</td><td>{data.data[i].lastname}</td><td>{data.data[i].birthday}</td><td>{data.data[i].gender}</td></tr>);
                        // console.log(data.data[i]);
                    }

                    // processData(data.data);
                }
            )
            .catch(
                (reason) => {
                    console.log("Error: \n" + reason);
                }
            )
            .finally(
                () => {
                    console.log("this is just a final signal.");
                }
            );

        function processData(data:any){
            console.log("processData()\n" + data);
        }



    var testOut = <div>edited quotes ne mi se veruva</div>;

    return <table>{rows}</table>;
}

export default Quotes;
